import "./ForgotPassword.css";
function ForgotPassword() {
  return (
    <>
      <main id="container">
        <h1>ForgotPassword</h1>
        <br></br>
        <form>
          <label htmlFor="email_id" id="email">
            Enter your email:
          </label>
          <br></br>
          <input id="email_id" placeholder="Enter your Email"></input>
          <br></br>
          <button id="forgotbtn">Send Mail</button>
        </form>
      </main>
    </>
  );
}
export default ForgotPassword;
